import './App.css';
import { Link } from 'react-router-dom';

import Navigation from './Navigation';

function Camera() {
return (
    <div>
        <Navigation className="py-16" />
        <div className='border-2 border-black rounded-xl mx-64 mb-16'>
            <div className="text-5xl mt-16 text-center fbask-reg">
            Camera ahh page.
            </div>
            <div className='fbask-ital mb-32 text-3xl text-center '>
            By: Anirud Lappathi and others
            </div>
        </div>


        <div className='flex align-auto justify-between'>
            <div className='fbask-reg text-3xl py-4'>
            Figure out your skin issues
            </div>
            <Link to="/camera">
            <button className='p-4 mx-32 border-2 border-black rounded-xl'>
                Camera
            </button>
            </Link>
        </div>
    </div>
    );
}

export default Camera;
